 stay focused on what matters. Stay Connected: With Bluetooth calling, you can answer calls directly from your wrist, keeping you in touch with your contacts on the go, and never missing an important call. Ready for Any Element: Dapper is not just stylish; it\'s also tough with an IP68 waterproof rating, ensuring it can handle whatever nature throws your way, come rain or shine. Secure and Convenient: Digital payments are made easy with NFC, adding an extra layer of security to your device, while enhancing convenience in your daily life. Your Fitness Partner: With 105+ sports modes and comprehensive health monitoring, this smartwatch supports your active lifestyle and wellness goals, providing data and insights to help you stay on track. (This is not a medical device). Power that Lasts: The 320mAh battery ensures that Dapper keeps up with your busy schedule. The watch needs to be charged for 3 hours to reach 100%. The charger should be a 3.7V to 5V adapter or any laptop output. For a bare minimum of 20% charge the watch needs to be charged for about 30-40 mins. Smart and Functional: Enjoy background app task management, customizable app skins, sports tracking videos, and SOS alerts for added safety. Personalize your watch with Album Watchfaces and even video watch faces for a unique touch. In the box- 1U Smartwatch, 1U Charging Cable, 1U Warranty, 1U Manual.',NULL,'Boltt Dapper’s 54.61 mm (2.15 inch) IPS Big Screen',1999,'Electronics',500,'WatchP1.webp','image/webp',_binary 'RIFF]\0\0WEBPVP8 ]\0\0P_*\>PH\"=	\K\#\\?شX>p̎\"ƷG\OnW\\\\9c\WS_+/l\~\\\`\?\Ypk?{{/\wOOS\\\xW~/\G_\\{\\\Ǻ/\\?u\Ew_8\'w\'&-\F\.q\\Gq\n\M\\e\4\s\%\\Z7\Ly\>\пC\Z\\~M\'\\6[A\Y#BoϿ%~\"̺	GQ,D\}|\\"HL)\ -?\\K\rӀ(f\\'ml3x\y#W\'8\\Ζf\,TI\mPWpWo0\v	$>LMV\;d\\\~^\\Cq\<t\\^T\D_,s5CS\2R\B\YML\iieӽ80\b;\6\\9ZR\\JPCRC\\\Sȶ\\cj\O`(\\\!}t\CmR\ދtL_H0wê6]A\4BiS$\'8\\*AJş9\\\'`aEڴ\̲\TRc\8b\Dg\\rkg&}\#\#\˰\\㯀\+ߨ@j\Zip>K\6i%\w8^\cE9\\\p\'